import React, { Component } from "react";
import 'react-sticky-header/styles.css';
import StickyHeader from 'react-sticky-header';


class HeaderPatient extends Component {
    constructor() {
        super();
        this.state = {

        }
    }

    render() {
        return (
            <Navbar fixedTop>
              <Navbar.Header>
                <Navbar.Brand>
                  <a href="/">
                    Our Awesome Store
                  </a>
                </Navbar.Brand>
                <Navbar.Toggle />
              </Navbar.Header>
              <Navbar.Collapse>
                <Nav pullRight>
                  <NavItem
                    eventKey={1}
                    href="#">
                    Home
                  </NavItem>
                  <NavItem
                    eventKey={2}
                    href="#">
                    Shop
                  </NavItem>
                  <NavItem
                    eventKey={3}
                    href="#">
                    {/* <Glyphicon glyph="shopping-cart" /> */}
                    {' Cart'}
                  </NavItem>
                </Nav>
              </Navbar.Collapse>
            </Navbar>
          );
    }
}
export { HeaderPatient }
